import React from "react";
import './SideBar.css';
const SideBar = (props) => {
    console.log(props);
    const renderContactList = props.NoteArray.map((note) => {
        return(
            <div className="item">
                <div className="content">
                    <div className="header">{note.title}</div>
                    <div className="description">{note.body}</div>
                </div>
            </div>
        )});

    return(
    <div className="Bar">
            <div className="SideBarTitle">
                <h3 className="Notes"><b>Notes</b></h3>
                <button className="PlusButton">&#10133;</button>
            </div>
            <div className="SideBarContent">
                <div className="ui celled list">{renderContactList}</div>
            </div>
    </div>)

};
export default SideBar;
